import React from "react";
import { useStyles } from "./style";
import { Button, Grid, Typography } from "@material-ui/core";

// import { Container } from './styles';

export default function HomePage() {
  const classes = useStyles();
  return (
    <Grid container className={classes.root}>
      <Grid item className={classes.header} xs={12}>
        <Grid container classeName={classes.headerContent}>
          <Grid item className={classes.login} xs={12}>
            <Button className={classes.Btcadastro} variant="contained">
              Cadastre-se
            </Button>
            <Button
              className={classes.Btlogin}
              variant="contained"
              color="primary"
            >
              Login
            </Button>
          </Grid>
          <Grid item className={classes.titulo} xs={12}>
            <Typography>
              Somos a sua rede de apoio para o mercado de trabalho.
            </Typography>
          </Grid>
        </Grid>
      </Grid>
      <Grid item className={classes.content} xs={12}></Grid>
    </Grid>
  );
}
